import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { match as Match } from "react-router-dom";
import "./index.css";
import { LoadAudioset } from "./LoadAudioset";
import NotFound from "./NotFound";

// App layout styles are defined at index.html
const AppRouter = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact={true} component={App} />
        <Route path="/set/:id" exact={true} component={App} />
        <Route component={NotFound} />
      </Switch>
    </Router>
  );
};

export default AppRouter;

interface AppParams {
  id: string;
}

interface AppProps {
  match: Match<AppParams>;
}
export const App = ({ match }: AppProps) => {
  const id = match.params.id || "index";
  return LoadAudioset({ id });
};
